import java.util.Hashtable;

public class Main {
    public static void main(String[] args) {
        Hashtable<String, Integer> table = new Hashtable<>();

        // Add initial data
        table.put("A", 10);
        table.put("B", 20);

        // Some unrelated operations
        int x = 100;
        x += 200;

        // Conditional logic affecting write point
        if (x > 50) {
            /* write */ table.put("C", 30);
        } else {
            table.put("D", 40);
        }

        // More operations on the hashtable
        table.put("E", 50);
        table.computeIfPresent("A", (key, val) -> val + 5);
        table.remove("B");
        int sum = 0;
        for (Integer value : table.values()) {
            sum += value;
        }

        // Further obfuscated indices
        if (x % 2 == 0) {
            table.put("F", sum);
        } else {
            table.put("G", sum / 2);
        }

        // Read point
        /* read */ int ret = table.get("C");
        System.out.println("Retrieved value: " + ret);
    }
}
